import React from 'react';

const Reservations = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}
    >
      <h1>Reservations</h1>
    </div>
  );
};

export default Reservations;
